import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super();

    this.state = {
      houses: [
        {
          name: 'Los Arcos',
          id: '1'
        },
        {
          name: 'Rinconada Los Nogaeles',
          id: '2'
        },
        {
          name: 'San Guillermo',
          id: '3'
        }
      ]
    };
  }

  componentDidMount(){
    fetch('https:').then(response => response.json())
    .then(users => this.setState({monsters: users})); //console.log(users));
  }

  render() {
    return (
      <div className="App">
      {this.state.houses.map(house => (
        <h1 key={house.id}> {house.name} </h1>
        ))}
      </div>
    )
  }
}

export default App;
